<p>在python中字节串以<code>b""</code>闭合，以<code>\\x ASCII码</code>形式存储，在遍历时会遍历每一个<code>\\x</code>块，那么这样的话就可以避免unicode存储时看见迷惑的字符，可以更加直观地处理数据</p>
